    <!-- page script -->
    <script>
        $(function () {
            /* ChartJS
             * -------
             * Here we will create a few charts using ChartJS
             */

            async function doAjax() {
               let result;

               try {
                   result = await $.ajax({
                       url: ""https://localhost:44337/policy/datajson"",
                       type: 'GET'
                   });

                   console.log(result);
                   return result;
               } catch (error) {
                   console.error(error);
               }
            }

            // Llamarla y usarla como promesa
            var data;
            doAjax().then(resultado => {
                console.log(""El resultado es: "", resultado[0]);
                data = resultado;
                
                console.log(data);

                var dataLabels = [];
                var dataValues = [];

                var data_1 = data[0];
   ");
                WriteLiteral(@"             for (var i = 0; i < data_1.length; i++) {

                    dataLabels.push(data_1[i].period)
                    dataValues.push(data_1[i].netSales)
                    
                }
           
                //-------------
                //- BAR CHART -
                //-------------

                var barChartCanvas = $('#barChart').get(0).getContext('2d')

                var barChartOptions = {
                    responsive: true,
                    maintainAspectRatio: false,
                    datasetFill: false
                }

                var barChart = new Chart(barChartCanvas, {
                    type: 'bar',
                    data: {
                        datasets: [{
                            label: 'Ventas',
                            data: dataValues
                        }],
                        labels: dataLabels
                    },
                    options: barChartOptions
                })

            })

        })
    </scri");
